webpackJsonp([0x70affcf3eb1a],{1468:function(a,e){a.exports={data:{markdownRemark:{html:"<p>民謡と踊りの食べ物の街には、古代皇帝の生活のような、食べ物や観覧中のフォークソングやダンスの演奏が特徴です。最も活発なショーは招待されたゲストをステージに招待し、秦を受け入れ、一緒に踊るなどです。雰囲気があります。</p>\n<p>この場所はもともとナショナル・ソング・ダンス・グループのリハーサル・ホールでしたが、今はレストランになっています。その前には多くのスペースがあり、おそらくリハーサルが可能です。これは間違いなく市場経済の現象です。歌舞伎のリハーサルホールはレストランになっており、中国社会の発展の典型的な象徴でもあります。しかし、それが上向きの開発であるとは言い難い。</p>",id:"/home/swain/workspace/political-life/src/pages/ja/0119.md absPath of file >>> MarkdownRemark",fileAbsolutePath:"/home/swain/workspace/political-life/src/pages/ja/0119.md",frontmatter:{title:"7月8日 金曜日"}}},pathContext:{id:"/home/swain/workspace/political-life/src/pages/ja/0119.md absPath of file >>> MarkdownRemark"}}}});
